INSERT INTO `t18_do_disease` VALUES (321,'tropical spastic paraparesis','A viral infectious disease that results_in inflammation located_in spinal cord, has_material_basis_in Human T-lymphotropic virus 1, which is transmitted_by sexual contact, and transmitted_by breast feeding. The infection has_symptom spastic weakness of both legs, has_symptom muscle stiffness, has_symptom sensory disturbance, and has_symptom spasms. http://en.wikipedia.org/wiki/Tropical_spastic_paraparesis, http://www.merckmanuals.com/professional/sec16/ch224/ch224k.html','is_a viral infection disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(1060,'Hartnup disorder','An amino acid metabolic disorder that is caused by abnormalities of the renal tubules and is characterized especially by aminoaciduria involving only monocarboxylic monoamines, a dry red scaly rash, and episodic muscular incoordination due to the effects of the disease on the cerebellum.http://www2.merriam-webster.com/cgi-bin/mwmednlm?book=Medical&va=Hartnup','is_a amino acid metabolic disorder','2024-05-05 15:59:10','2024-05-05 15:59:10'),(1099,'alpha thalassemia','Alpha thalassemia is a thalassemia involving the genes HBA1and HBA2 hemoglobin genes. ','is_a thalassemia','2024-05-05 15:59:10','2024-05-05 15:59:10'),(1386,'abetalipoproteinemia','A hypolipoproteinemia that is characterized by an inablility to fully absorb dietary fats, cholesterol and fat-soluble vitamins, has_physical_basis_in an autosomal recessive disorder of lipid metabolism that has material basis in mutation in the microsomal triglyceride transfer protein that catalyzes the transport of lipids (TRIGLYCERIDES; CHOLESTEROL ESTERS; PHOSPHOLIPIDS) and is required in the secretion of BETA-LIPOPROTEINS (low density lipoproteins or LDL).','is_a hypolipoproteinemia','2024-05-05 15:59:10','2024-05-05 15:59:10'),(1520,'colon carcinoma','A colon cancer that has_material_basis_in abnormally proliferating cells derives_from epithelial cells. ','is_a colon cancer','2024-05-05 15:59:10','2024-05-05 15:59:10'),(1612,'breast cancer','A thoracic cancer that originates in the mammary gland.','is_a thoracic cancer','2024-05-05 15:59:10','2024-05-05 15:59:10'),(1793,'pancreatic cancer','An endocrine gland cancer located_in the pancreas.','is_a endocrine gland cancer','2024-05-05 15:59:10','2024-05-05 15:59:10'),(1858,'McCune Albright syndrome','An autosomal dominant disease that involves skin pigmentation, bone and hormonal problems along with premature puberty. It has material basis in mutations in the GNAS1 gene.','is_a autosomal dominant disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(2394,'ovarian cancer','A female reproductive organ cancer that is located_in the ovary. ','is_a female reproductive organ cancer','2024-05-05 15:59:10','2024-05-05 15:59:10'),(2538,'Landau-Kleffner syndrome',NULL,'is_a childhood electroclinical syndrome','2024-05-05 15:59:10','2024-05-05 15:59:10'),(2729,'dyskeratosis congenita','A skin disease characterized by cutaneous pigmentation, premature graying, dystrophy of the nails, leukoplakia of the oral mucosa, continuous lacrimation due to atresia of the lacrimal ducts, often thrombocytopenia, anemia, testicular atrophy in the male carriers and predisposition to cancer.','is_a skin disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(2842,'Jervell-Lange Nielsen syndrome','n/a','is_a long QT Syndrome','2024-05-05 15:59:10','2024-05-05 15:59:10'),(2843,'Long QT Syndrome','An autosomal genetic disease that is characterized by delayed repolarization of the heart following a heartbeat increases the risk of episodes of torsade de pointes (TDP, a form of irregular heartbeat that originates from the ventricles). http://en.wikipedia.org/wiki/Long_QT_syndrome','is_a intrinsic cardiomyopathy','2024-05-05 15:59:10','2024-05-05 15:59:10'),(2861,'congenital nonspherocytic hemolytic anemia',NULL,'is_a congenital hemolytic anemia','2024-05-05 15:59:10','2024-05-05 15:59:10'),(3070,'malignant glioma','A cell type cancer that has_material_basis_in glial cells and is located_in brain or located_in spine. ','is_a cell type cancer','2024-05-05 15:59:10','2024-05-05 15:59:10'),(3263,'piebaldism',NULL,'is_a autosomal dominant disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(3529,'central core myopathy',NULL,'is_a congenital structural myopathy','2024-05-05 15:59:10','2024-05-05 15:59:10'),(3883,'Lynch syndrome','An autosomal dominant disease that is characterized by \\nand has_material_basis_in mutation of mismatch repair genes that increases the risk of many types of cancers. ','is_a autosomal dominant disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(3901,'Vulvitis','(noe)','is_a vulvar disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(4184,'pseudohypoparathyroidism',NULL,'is_a metal metabolism disorder','2024-05-05 15:59:10','2024-05-05 15:59:10'),(4257,'Caffey disease',' A bone inflammation disease that causes bone changes, soft tissue swelling and irritability in infants. The disease has been associated with COL1A1 gene. It has_symptom soft-tissue swelling, has_symptom bone lesions, and has_symptom irritability. ','is_a bone inflammation disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(4440,'seminoma','A germinoma that has_material_basis_in cells that make sperm and eggs. http://www.cancer.gov/dictionary?CdrID=46577','is_a germ cell cancer','2024-05-05 15:59:10','2024-05-05 15:59:10'),(4617,'periapical granuloma',NULL,'is_a periapical periodontitis','2024-05-05 15:59:10','2024-05-05 15:59:10'),(4674,'androgen insensitivity syndrome','A sex differentiation disease that is characterized by the partial or complete inability of the cell to respond to androgens in individuals with a karyotype of 46,XY resulting in female physical traits but male genetic makeup.','is_a sex differentiation disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(4964,'neurotic disorder','An anxiety disorder that involves discress but neither delusions nor hallucinations.','is_a anxiety disorder','2024-05-05 15:59:10','2024-05-05 15:59:10'),(5520,'head and neck squamous cell carcinoma','A head and neck carcinoma that has_material_basis_in squamous cells that line the moist, mucosal surfaces inside the head and neck.','is_a head and neck carcinoma','2024-05-05 15:59:10','2024-05-05 15:59:10'),(5683,'hereditary breast ovarian cancer','An autosomal dominant disease characterized by the higher than normal tendency to develop breast and ovarian cancers in genetically related families.','is_a autosomal dominant disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(6456,'Cowden disease','An autosomal dominant disease characterized by multiple noncancerous, tumor-like growths (hamartomas) and an increased risk of certain forms of cancer, especially breast, thyroid and endometrium. It is caused by mutations in the PTEN, SDHB, SDHD and KLLN genes.','is_a autosomal dominant disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(6457,'Cowden disease','An autosomal dominant disease characterized by multiple noncancerous, tumor-like growths (hamartomas) and an increased risk of certain forms of cancer, especially breast, thyroid and endometrium. It is caused by mutations in the PTEN, SDHB, SDHD and KLLN genes. ','is_a autosomal dominant disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(8545,'malignant hyperthermia','A genetic disease that is characterized by a drastic and uncontrolled increase in skeletal muscle oxidative metabolism, which overwhelms the body\'s capacity to supply oxygen, remove carbon dioxide, and regulate body temperature. ','is_a genetic disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(8912,'tinea nigra','A superficial mycosis that is a superficial fungal infection of the skin characterized by brown to black macules which usually occur on the palmar aspects of hands and occasionally the plantar and other surfaces of the skin, caused by Hortaea werneckii, which is a common saprophytic fungus believed to occur in soil, compost, humus and on wood in humid tropical and sub-tropical regions.','is_a superficial mycosis','2024-05-05 15:59:10','2024-05-05 15:59:10'),(9007,'sudden infant death syndrome','A syndrome that is characterized by the sudden death of an infant that is not predicted by medical history and remains unexplained after a thorough forensic autopsy and detailed death scene investigation. http://en.wikipedia.org/wiki/Sudden_infant_death_syndrome, http://omim.org/entry/272120, http://www.nlm.nih.gov/medlineplus/suddeninfantdeathsyndrome.html','is_a syndrome','2024-05-05 15:59:10','2024-05-05 15:59:10'),(9119,'acute myeloid leukemia','A myeloid leukemia that is characterized by the rapid growth of abnormal white blood cells that accumulate in the bone marrow and interfere with the production of normal blood cells. http://cancergenome.nih.gov/cancersselected/acutemyeloidleukemia, http://en.wikipedia.org/wiki/Acute_myeloid_leukemia, http://www.cancer.gov/dictionary?cdrid=44363','is_a myeloid leukemia','2024-05-05 15:59:10','2024-05-05 15:59:10'),(9253,'gastrointestinal stromal tumor',NULL,'is_a gastrointestinal system cancer','2024-05-05 15:59:10','2024-05-05 15:59:10'),(9256,'colorectal cancer','A large intestine cancer that is located_in the colon and/or located_in the rectum. ','is_a large intestine cancer','2024-05-05 15:59:10','2024-05-05 15:59:10'),(9352,'Type 2 Diabetes Mellitus','A diabetes mellitus that involves high blood glucose resulting from cells fail to use insulin properly. http://en.wikipedia.org/wiki/Diabetes, http://en.wikipedia.org/wiki/Diabetes_mellitus_type_2','is_a diabetes mellitus','2024-05-05 15:59:10','2024-05-05 15:59:10'),(9598,'fasciitis',NULL,'is_a connective tissue disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(10041,'dysplastic nevus syndrome',NULL,'is_a autosomal dominant disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(10241,'thalassemia',NULL,'is_a autosomal recessive disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(10329,'pneumoconiosis due to talc',NULL,'is_a pneumoconiosis','2024-05-05 15:59:10','2024-05-05 15:59:10'),(10383,'amyotrophic neuralgia',NULL,'is_a brachial plexus neuropathy','2024-05-05 15:59:10','2024-05-05 15:59:10'),(10782,'mesenteric lymphadenitis','none','is_a lymphadenitis','2024-05-05 15:59:10','2024-05-05 15:59:10'),(10914,'amnestic disorder','A cognitive disorder where the memory is disturbed or lost and involves the loss of memories previously established, loss of the ability to create new memories, or loss of the ability to learn new information.','is_a cognitive disorder','2024-05-05 15:59:10','2024-05-05 15:59:10'),(10923,'sickle cell anemia',NULL,'is_a autosomal recessive disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(11476,'osteoporosis','A bone resorption disease characterized by decreased density of normally mineralized bone which results_in the thinning of bone tissue and decreased mechanical strength. ','is_a bone resorption disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(11726,'Emery-Dreifuss muscular dystrophy','A muscular dystrophy that chiefly affects muscles used for movement (skeletal) and heart (cardiac) muscle. ','is_a muscular dystrophy','2024-05-05 15:59:10','2024-05-05 15:59:10'),(12241,'beta thalassemia','A thalassemia characterized by the reduced or absent synthesis of the beta globin chains of hemoglobin.','is_a thalassemia','2024-05-05 15:59:10','2024-05-05 15:59:10'),(12347,'osteogenesis imperfecta','An osteochondrodysplasia that has_material_basis_in a deficiency in type-I collagen which results_in brittle bones and defective connective tissue. ','is_a osteochondrodysplasia','2024-05-05 15:59:10','2024-05-05 15:59:10'),(12449,'aplastic anemia','An anemia that is characterized by a deficiency of red blood cells, white blood cells and platelets produced by bone marrow.','is_a anemia','2024-05-05 15:59:10','2024-05-05 15:59:10'),(12554,'hemolytic-uremic syndrome',NULL,'is_a hemolytic anemia','2024-05-05 15:59:10','2024-05-05 15:59:10'),(12712,'nephronophthisis','An autosomal recessive disease that is characterized by a chronic tubulointerstitial nephritis that progress to terminal renal failure during the second decade (juvenile form) or before the age of 5 years (infantile form) resulting from dysfunction of ciliary proteins (ciliopathy).','is_a autosomal recessive disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(12930,'dilated cardiomyopathy','An intrinsic cardiomyopathy that is characterized by an an enlarged heart and damage to the myocardium causing the heart to pump blood inefficiently. http://en.wikipedia.org/wiki/Dilated_cardiomyopathy','is_an intrisic cardiomyopathy','2024-05-05 15:59:10','2024-05-05 15:59:10'),(13270,'erythropoietic protoporphyria','An acute porphyria characterized by a deficiency in the enzyme ferrochelatase, leading to abnormally high levels of protoporphyrin in the tissue.','is_a acute porphyria','2024-05-05 15:59:10','2024-05-05 15:59:10'),(13317,'hyperinsulinemic hypoglycemia','A carbohydrate metabolic disorder that involves low blood glucose resulting from an excess of insulin. http://en.wikipedia.org/wiki/Hyperinsulinemic_hypoglycemia','is_a carbohydrate metabolic disorder','2024-05-05 15:59:10','2024-05-05 15:59:10'),(13381,'pernicious anemia',NULL,'is_a nutritional deficiency disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(13482,'Proteus syndrome',NULL,'is_a physical disorder','2024-05-05 15:59:10','2024-05-05 15:59:10'),(13636,'Fanconi\'s anemia','A congenital hypoplastic anemia characterized by progressive pancytopenia with bone marrow failure, variable congenital malformations and predisposition to develop hematological or solid tumors. It is a result of a genetic defect in a cluster of proteins responsible for DNA repair.','is_a congenital hypoplastic anemia','2024-05-05 15:59:10','2024-05-05 15:59:10'),(13884,'sick sinus syndrome',NULL,'is_a sinoatrial node disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(14499,'Fabry disease','is_a sphingolipidosis',NULL,'2024-05-05 15:59:10','2024-05-05 15:59:10'),(14557,'primary pulmonary hypertension','A chronic pulmonary heart disease characterized by an increase of blood pressure in the pulmonary artery, pulmonary vein, or pulmonary capillaries, among others, has symptoms shortness of breath, dizziness, fainting, leg swelling. http://en.wikipedia.org/wiki/Pulmonary_hypertension, http://ghr.nlm.nih.gov/condition/pulmonary-arterial-hypertension','is_a chronic pulmonary heart disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(14711,'FG syndrome','An X-linked disease characterized by retardation, hyperactivity, hypotonia, broad thumbs, big first toes and a characteristic facial appearance including macrocephaly and has an X-linked recessive inheritance pattern. http://en.wikipedia.org/wiki/FG_syndrome, http://ghr.nlm.nih.gov/condition/fg-syndrome, http://rarediseases.info.nih.gov/gard/2317/fg-syndrome/resources/1','is_a X-linked disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(14720,'type I Ehlers-Danlos syndrome',NULL,'is_a Ehlers-Danlos syndrome','2024-05-05 15:59:10','2024-05-05 15:59:10'),(50440,'familial partial lipodystrophy','A lipodystrophy characterized by abnormal subcutaneous adipose tissue distribution beginning in late childhood or early adult life. ','is_a lipodystrophy','2024-05-05 15:59:10','2024-05-05 15:59:10'),(50454,'periventricular nodular heterotopia','A congenital nervous system abnormality characterized by non proper migration of neurons during the early development of the fetal brain. http://ghr.nlm.nih.gov/condition/periventricular-heterotopia','is_a congenital nervous system abnormality','2024-05-05 15:59:10','2024-05-05 15:59:10'),(50470,'Donohue Syndrome',NULL,'is_a autosomal recessive disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(50475,'Weill-Marchesani syndrome','An autosomal genetic disease characterized by short stature, bachycephaly and other facial abnormalities, brachydactyly, joint stiffness and distinctive ocular abnormalities. ','is_a autosomal genetic disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(50557,'congenital muscular dystrophy','A muscular dystrophy that is characterized by diminished muscle tone (hypotonia), progressive muscle weakness and degeneration (atrophy), abnormally fixed joints, spinal rigidity, and delays in reaching motor milestones such as sitting or standing unassisted.','is_a muscular dystrophy','2024-05-05 15:59:10','2024-05-05 15:59:10'),(50559,'Fukuyama congenital muscular dystrophy','A congenital muscular dystrophy-dystroglycanopathy type A that is characterized by muscle weakness, failure to thrive, severe intellectual and developmental disability, impaired vision and cardiac abnormalities and has_material_basis_in mutation in the FKTN gene that produces the fukutin protein.','is_a congenital muscular dystrophy-dystroglycanopathy type A','2024-05-05 15:59:10','2024-05-05 15:59:10'),(50585,'congenital generalized lipodystrophy',NULL,'is_a lipidotrophy','2024-05-05 15:59:10','2024-05-05 15:59:10'),(50650,'familial atrial fibrillation','An atrial fibrillation that has_material_basis_in autosomal dominant inheritance of the familial atrial fibrillation (ATFB) genes. http://en.wikipedia.org/wiki/Familial_atrial_fibrillation','is_a atrial fibrillation','2024-05-05 15:59:10','2024-05-05 15:59:10'),(50657,'Bannayan-Riley-Ruvalcaba syndrome',NULL,'is_a autosomal dominant disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(50782,'Zollinger-Ellison syndrome','A syndrome that is haracterized by the development of a one or more tumors (gastrinoma) in the pancreas, duodenum, or both that secrete excessive levels of gastrin, a hormone that stimulates production of acid by the stomach. ','is_a syndrome','2024-05-05 15:59:10','2024-05-05 15:59:10'),(50793,'Short QT syndrome','A heart conduction disease that is characterized by heart arrhythmia defined as a short QT interval on an EKG (less than 300 ms) that does not significantly change with heart rate, tall and peaked T waves, and a structurally normal heart. ','is_a heart conduction disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(60161,'Kennedy\'s Disease','A spinal muscular dystrophy that has_material_basis_in an X-linked recessive expansion of CAG triplet repeats (glutamine) in exon 1 of AR gene encoding the androgen receptor.','is_a spinal muscular atrophy','2024-05-05 15:59:10','2024-05-05 15:59:10'),(60354,'Stormorken syndrome','A blood platelet disease characterized by thrombocytopathy, thrombocytopenia, mild anemia, asplenia, tubular aggregate myopathy, miosis, headache, and ichthyosis. It has material basis in heterozygous mutation in the STM1 gene on chromosome 11p15. It has an autosomal dominant inheritance pattern.','is_a blood platelet disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(70491,'mitochondrial complex IV deficiency nuclear type 1','A COX deficiency, benign infantile mitochondrial myopathy that has_material_basis_in homozygous or compound heterozygous mutation in the SURF1 gene on chromosome 9q34.2.https://pubmed.ncbi.nlm.nih.gov/10746561/','is_a COX deficiency, benign infantile mitochondrial myopathy, is_a autosomal recessive disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(80053,'Albright\'s hereditary osteodystrophy','An osteochondrodysplasia that has_material_basis_in lack of responsiveness to parathyroid hormone which results_in shortening and widening of long bones of the located_in hand or located_in foot along with short stature, obesity, and rounded face.','is_a pseudohypoparathyroidism','2024-05-05 15:59:10','2024-05-05 15:59:10'),(80212,'polycystic kidney disease 4','A autosomal recessive polycystic kidney disease that has_material_basis_in mutation in the PKD4 gene.','is_a autosomal recessive polycystic kidney disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(80394,'nephrotic syndrome type 19','A familial nephrotic syndrome that has_material_basis_in compound heterozygous mutation in the NUP160 gene on chromosome 11p11.','is_a familial nephrotic syndrome, is_a autosomal recessive disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(110031,'hemoglobin H disease','An alpha thalassemia that has material basis in contiguous gene deletion of the hemoglobin alpha-1 (HBA1) and alpha-2 (HBA2) genes on one chromosome 16, and a defect, deletional or nondeletional, in either HBA1 or HBA2 on the other.','is_a alpha thalassemia','2024-05-05 15:59:10','2024-05-05 15:59:10'),(110187,'Charcot-Marie-Tooth disease 4K ','A Charcot-Marie-Tooth disease type 4 that has_material_basis_in homozygous or compound heterozygous mutation in the SURF1 gene on chromosome 9q34.','is_a Charcot-Marie-Tooth disease type 4, is_a autosomal recessive disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(110218,'Brugada syndrome 1','A Brugada syndrome that has material basis in heterozygous mutation in the SCN5A gene on chromosome 3p22. http://www.ncbi.nlm.nih.gov/pubmed/?term=9521325','is_a Brugada syndrome','2024-05-05 15:59:10','2024-05-05 15:59:10'),(110301,'autosomal dominant limb-girdle muscular dystrophy type 1B','An autosomal dominant limb-girdle muscular dystrophy that has_material_basis_in mutation in the gene encoding lamin A/C (LMNA). http://www.ncbi.nlm.nih.gov/pubmed/?term=10814726','is_a autosomal dominant limb-girdle muscular dystrophy','2024-05-05 15:59:10','2024-05-05 15:59:10'),(110315,'hypertrophic cardiomyopathy 9','A hypertrophic cardiomyopathy that has_material_basis_in heterozygous mutation in the TTN gene on chromosome 2q31. ','is_a hypertrophic cardiomyopathy','2024-05-05 15:59:10','2024-05-05 15:59:10'),(110425,'dilated cardiomyopathy 1A','A dilated cardiomyopathy that has_material_basis_in mutation in the LMNA gene on chromosome 1q21.','is_a dilated cardiomyopathy','2024-05-05 15:59:10','2024-05-05 15:59:10'),(110430,'dilated cardiomyopathy 1G','A dilated cardiomyopathy that has_material_basis_in mutation in the TTN gene on chromosome 2q31','is_a dilated cardiomyopathy','2024-05-05 15:59:10','2024-05-05 15:59:10'),(110861,'autosomal recessive polycystic kidney disease','A polycystic kidney disease characterized by the presence of multiple cysts located_in the kidney resulting from ciliopathy that disrupts the function of primary cilium, inherited in an autosomal recessive fashion.','is_a polycystic kidney disease   is_a autosomal recessive disease ','2024-05-05 15:59:10','2024-05-05 15:59:10'),(112207,'developmental and epileptic encephalopathy 71','A developmental and epileptic encephalopathy characterized by early neonatal refractory seizures, respiratory failure, structural brain abnormalities and cerebral edema, with death within weeks after birth that has_material_basis_in homozygous or compound heterozygous mutation in GLS on chromosome 2q32.2.','is_a developmental and epileptic encephalopathy, is_a autosomal recessive disease','2024-05-05 15:59:10','2024-05-05 15:59:10'),(112265,'iminoglycinuria','A renal tubular transport disease characterized by impaired renal tube reabsorption of proline, hydroxyproline and glycine and elevated urine levels of the imino acids and glycine that has_material_basis_in homozygous mutation in SLC36A2 on chromosome 5q33.1 combined with either heterozygous mutation in SLC6A20 gene on chromosome 3p21.31 or homozygous mutation in SLC6A19 on chromosome 5p15.33.https://pubmed.ncbi.nlm.nih.gov/19033659/','is_a renal tubular transport disease, is_a digenic disease','2024-05-05 15:59:10','2024-05-05 15:59:10');
